import React from "react";
import { Redirect, Route } from "react-router";
import { Sign } from "../sign";
import { CustomersLimit } from "../customersLimit";
import { NavBar } from "../components/navBar/index";
import { Apps } from "../components/Apps";

function App() {
  return (
    <div>
      <Route exact path="/">
        <Redirect to="/signin" />
      </Route>
      <Route path="/signin">
        <Sign />
      </Route>
      <Route path="/apps">
        <NavBar />
        <Apps />
      </Route>
      <Route path="/metrics">
        <NavBar />
        <CustomersLimit />
      </Route>
    </div>
  );
}

export default App;
